const initialStateState=1;
const count=(state=initialStateState,action)=>{
    switch(action.type){
            case 'SUM-MONEY':
                console.log("ôk")
                console.log("ôk")
                console.log("ôk")
                console.log("ôk")
                state=action.value
            
              default: return state
    }
}
export default count;
